import React from "react";

const ProductItem = (props) => {
  const { color, description, id, image, name, price } = props.data;
  console.log(description);
  return (
    <div className="product-item">
      <div className="product-item-img">
        <img src={image} alt="#" />
      </div>
      <div className="product-item-name">{name}</div>
      <div className="product-item-description">{description}</div>
      <div className="product-item-name">sss</div>
      <div className="product-item-info">
        <div className="product-price">{price}</div>
        <div className="product-checked">
          <img src="/image/check.png" alt="" />
        </div>
      </div>
    </div>
  );
};

export default ProductItem;
